description:
Jelena is a fresh and young new face on Canada Tgirl. She comes to us from the small South Ontario community of Waterloo/Kitchener. It is evident to me that she has European ancestry, as is characteristic of many girls in that area. Jelena has perfect skin that is silky and white. She probably has some of the prettiest hair out of all the tgirls in Canada. Jelena comes from an artistic background - a dancer of over 10 years. She is fond of the spiritual realm, enjoys reading, and is very intelligent. Jelena also takes an interest in Greek Mythology. I would say she is quite the Aphrodite! Welcome to CANTG, Jelena. We hope you stay awhile!

